import styles from '../styles/Home.module.css';
import React, { Component } from 'react';

class PersonalProjects extends Component {
    constructor() {
        super();
        this.state = {
            personal_projects_list: [
                {
                    "id": 0,
                    "name": "Portfolio",
                    "category": "Front-end Web Development",
                    "description": "Personal portfolio that showcases my notable software projects.",
                    "technologies": ["next.js", "react.js", "JSX", "TypeScript", "HTML5", "CSS", "Git", "GitHub"],
                    "Source": "https://github.com/bud-smith/Portfolio"
                }
            ]
        };
    }

    get get_personal_projects() {
        return this.personal_projects_list;
    }

    render() {
        return (
            <div id="personal-projects" className="project-div">
                <h1 className="centre-text">Personal Projects</h1>
                <p className="centre-text">This is a set of my notable personal projects. Due to grow soon.</p>
                {this.personal_projects_list[0].category}
            </div>
        );
    }
}

export default PersonalProjects;
